sap.ui.define([
	"sap/ui/core/mvc/Controller",
	"sap/ui/model/odata/ODataUtils",
	"com/eramet/maintenanceF5D/model/models",
	"com/eramet/maintenanceF5D/util/util",
	"com/eramet/maintenanceF5D/util/formatter"
], function (Controller, ODataUtils, Models, util, formatter) {
	"use strict";
	return Controller.extend("com.eramet.maintenanceF5D.controller.BaseController", {
		oEventBus: sap.ui.getCore().getEventBus(),
		sViewName: "",
		
		applyTheme: function(sTheme) {
			this.getOwnerComponent().applyTheme(sTheme);
		},
		
		backToHome: function () {
			this.getRouter().navTo("Home");
		},
		
		setTitle: function() {
			var oElement = {
				"title": util.sTitleText
			};
			this.menuTitleModel(oElement);
		},
		
		onOpenCustomerDialog: function () {
			var customerDialog = sap.ui.xmlfragment("com.eramet.maintenanceF5D.view.fragment.customerDialog", this);
			this.getView().addDependent(customerDialog);
			customerDialog.open();  
		},
		
		onSelectCustomer: function (oEvent) {
			this._setTiles(oEvent.getSource().sId);
			this._onCloseCustomerialog();
		},
		
		_onCloseCustomerialog: function () {
			var core = sap.ui.getCore();
			core.byId("customerDialog").close();
			core.byId("customerDialog").destroy();
		},
		
		_setTiles: function (sValue) {
			this.getView().byId("customer").setIcon("");
			this.getView().byId("customer").removeStyleClass("green");
			this.getView().byId("customer").removeStyleClass("purple");
			this.getView().byId("customer").removeStyleClass("blue");

			if(sValue === "rondier") {
				this.getView().byId("customer").addStyleClass("green");
				this.getView().byId("customer").setText("R");
				util.sCustomer = "R";
				this._setDisplayModel("R");
			} else if (sValue === "depanner") {
				this.getView().byId("customer").addStyleClass("purple");
				this.getView().byId("customer").setText("D");
				util.sCustomer = "D";
				this._setDisplayModel("D");
			} else if (sValue === "technicien") {
				this.getView().byId("customer").addStyleClass("blue");
				this.getView().byId("customer").setText("T");
				util.sCustomer = "T";
				this._setDisplayModel("T");
			} else {
				this.getView().byId("customer").setIcon("sap-icon://customer");
				this.getView().byId("customer").setText("");
			}
		},
		
		_setDisplayModel: function (sValue) {
			var oElement = {};
			oElement.user = sValue;
			this.tilesModel(oElement);
		},
		
		createHeaderModel: function (oData) {
			Models.createHeaderModel(this.getView(), oData);
		}, 
		
		tilesModel: function (oData) {
			Models.tilesModel(this.getView(), oData);
		}, 
		
		menuTitleModel: function (oData) {
			Models.menuTitleModel(this.getView(), oData);
			Models.menuTitleModel(this.getView(), this.getView().getModel("menuTitleModel").getData());
			this.getView().getModel("menuTitleModel").refresh(true);
			this.getView().getModel("menuTitleModel").updateBindings(true);
		}, 
		
		listModel: function (oData) {
			Models.listModel(this.getView(), oData);
		}, 
		
		posteExecutantModel: function (oData) {
			Models.posteExecutantModel(this.getView(), oData);
		}, 
		
		equipmentVHModel: function (oData) {
			Models.equipmentVHModel(this.getView(), oData);
		}, 
		
		treeModel: function (oData) {
			Models.treeModel(this.getView(), oData);
		}, 
		
		rondierModel: function (oData) {
			Models.rondierModel(this.getView(), oData);
		}, 
		
		filterLabelModel: function (oData) {
			Models.filterLabelModel(this.getView(), oData);
		}, 
		
		avisDetail: function (oData) {
			Models.avisDetail(this.getView(), oData);
		}, 
		
		followupListModel: function (oData) {
			Models.followupListModel(this.getView(), oData);
		}, 
		
		workCenterModel: function (oData) {
			Models.workCenterModel(this.getView(), oData);
		}, 
		
		infoEquipmentModel: function (oData) {
			Models.infoEquipmentModel(this.getView(), oData);
		}, 
		
		equipmentViewModel: function (oData) {
			Models.equipmentViewModel(this.getView(), oData);
		}, 
		
		avisRattachesModel: function (oData) {
			Models.avisRattachesModel(this.getView(), oData);
		}, 
		
		avisDetailModel: function (oData) {
			Models.avisDetailModel(this.getView(), oData);
		}, 
		
		infoStockModel: function (oData) {
			Models.infoStockModel(this.getView(), oData);
		}, 
		
		otViewModel: function (oData) {
			Models.otViewModel(this.getView(), oData);
		},
		
		otDetailModel: function (oData) {
			Models.otDetailModel(this.getView(), oData);
		},
		
		opViewModel: function (oData) {
			Models.opViewModel(this.getView(), oData);
		},
		
		opDetailModel: function (oData) {
			Models.opDetailModel(this.getView(), oData);
		},
		
		avisUploadedModel: function (oData) {
			Models.avisUploadedModel(this.getView(), oData);
		},
		
		uploadedModel: function (oData) {
			Models.uploadedModel(this.getView(), oData);
		},
		
		documentModel: function (oData) {
			Models.documentModel(this.getView(), oData);
		},
		
		articleModel: function (oData) {
			Models.articleModel(this.getView(), oData);
		},
		
		testModel1: function (oData) {
			Models.testModel1(this.getView(), oData);
		},
		
		testModel2: function (oData) {
			Models.testModel2(this.getView(), oData);
		},
		
		filter: function (oBinding, aFilters) {
			oBinding.resetData();
			oBinding.sCustomParams = ODataUtils.createFilterParams(aFilters);
			oBinding.refresh();
		},

		getEntityURI: function (sFullUri) {
			var aSplit = sFullUri.split("/");
			return "/" + aSplit[aSplit.length - 1];
		},

		getI18nValue: function (sTextTag, sTab) {
			if (sTab === undefined) {
				return this.getResourceBundle().getText(sTextTag);
			} else {
				return this.getResourceBundle().getText(sTextTag, sTab);
			}
		},

		getModel: function (sName) {
			return this.getView().getModel(sName);
		},

		getResourceBundle: function () {
			return this.getOwnerComponent().getModel("i18n").getResourceBundle();
		},

		getRouter: function () {
			return sap.ui.core.UIComponent.getRouterFor(this);
		},

		getViewName: function () {
			return this.getView().getModel("app").getProperty("/ViewName");
		},
		
		navBack: function () {
			this.getOwnerComponent().navBack();
		},

		navFrom: function (sChannel, oEvent, oData) {
			this.getRouter().navTo(oData.Route, oData.Param);
		},

		navTo: function (sRoute, oParam) {
			this.oEventBus.publish("RoutingChannel", "onNavigate", {
				Route: sRoute,
				Param: oParam
			});
		},

		onPressCloseDialog: function (oEvent) {
			oEvent.getSource().getParent().close();
		},

		onPressHome: function () {
			this.navTo("Home");
		},

		playErrorSound: function () {
			var audio = new Audio("data:audio/wav;base64,");
			audio.oncanplaythrough = function () {
				audio.play();
			};
		},
		
		playSuccessSound: function () {
			var audio = new Audio("data:audio/wav;base64,");
			audio.oncanplaythrough = function () {
				audio.play();
			};
		},
		
		playWarningSound: function () {
			var audio = new Audio("data:audio/wav;base64,");
			audio.oncanplaythrough = function () {
				audio.play();
			};
		},
		
		registerNavFrom: function (oController) {
			this.oEventBus.subscribeOnce("RoutingChannel", "onNavigate", oController.navFrom, oController);
		},

		setAppBusy: function (bBusy) {
			this.getOwnerComponent().getModel("app").setProperty("/busy", bBusy);
		},

		setBusyIndicator: function (oElement, sState) {
			oElement.setBusy(sState);
		},

		setModel: function (oModel, sName) {
			return this.getView().setModel(oModel, sName);
		},

		setViewName: function (sName) {
			if(this.getModel("app") !== undefined){
				this.getModel("app").setProperty("/ViewName", sName);
			}
		},
		
		createViewModel: function (oData) {
			Models.createViewModel(this.getView(), oData);
		},
		
		_isSameRoute: function(sRoute, oParam) {
			var bSameRoute = true;
			// Check route
			if (sRoute !== this.getView().getModel("app").getProperty("/routing/route")) {
				bSameRoute = false;
			}

			// Check parameters
			if (typeof oParam === "undefined" && typeof this.getView().getModel("app").getProperty("/routing/params") !== "undefined" ||
				typeof oParam !== "undefined" && typeof this.getView().getModel("app").getProperty("/routing/params") === "undefined") {
				bSameRoute = false;
			} else if (typeof oParam !== "undefined" && typeof this.getView().getModel("app").getProperty("/routing/params") !== "undefined") {
				if (!this._isEquivalent(oParam, this.getView().getModel("app").getProperty("/routing/params"))) {
					bSameRoute = false;
				}
			}

			// If not same route
			if (!bSameRoute) {
				// Put in memory new route
				this.getView().getModel("app").setProperty("/routing/route", sRoute);
				this.getView().getModel("app").setProperty("/routing/params", oParam);
			}

			return bSameRoute;
		},

		move: function(aArray, iOldIndex, iNewIndex) {
			while (iOldIndex < 0) {
				iOldIndex += aArray.length;
			}
			while (iNewIndex < 0) {
				iNewIndex += aArray.length;
			}
			if (iNewIndex >= aArray.length) {
				var k = iNewIndex - aArray.length;
				while ((k--) + 1) {
					aArray.push(undefined);
				}
			}
			aArray.splice(iNewIndex, 0, aArray.splice(iOldIndex, 1)[0]);
			return aArray;
		}
	});
});